INSERT INTO `wp_options` VALUES (1968,'_transient_ao_ccss_explain','<div class=\'ao_i18n\' id=\'default\'>\n    <h2>Improve first paint times by removing render-blocking CSS</h2>\n    <div style=\"width:100%;overflow:hidden\">\n    <div style=\"width:68%;float:left\">\n      <p>Is Google Pagespeed Insights complaining about <strong>render-blocking CSS</strong>? Are your <strong>first paint times</strong> sub-optimal because of that render-blocking CSS?</p>\n      <p><strong>Above the fold CSS</strong> (as part of Autoptimize\'s \"Inline &amp; defer CSS\") can help you improve, but <strong>most sites need different critical CSS for different types of pages</strong> and generating the correct code can be hard!</p>\n      <p>The solution? <strong>Sign up at <a href=\"https://criticalcss.com/?aff=1\" target=\"_blank\">https://criticalcss.com</a></strong> (premium service, price 2 GBP/month for membership and 5 GBP/month per domain) <strong>and get the API key from <a href=\"https://criticalcss.com/account/api-keys?aff=1\" target=\"_blank\">the API-keys page</a></strong> and paste that key below.</p>\n      <p>If you have any questions or need support, head on over to <a href=\"https://wordpress.org/support/plugin/autoptimize\" target=\"_blank\">our support forum</a> and we\'ll help you get up and running in no time!</p>\n    </div>\n    <div style=\"width:28%;float:right\"><img src=\"https://criticalcss.com/images/criticalcss-optimised-website-illustration.svg\" width=\"350px\"></div>\n    </div>\n</div>\n<div class=\'ao_i18n\' id=\'nl\'>\n    <h2>Verbeter de eerste weergave-tijd door blokkerende CSS te verwijderen</h2>\n    <div style=\"width:100%;overflow:hidden\">\n    <div style=\"width:68%;float:left\">\n      <p>Klaagt Google Pagespeed Insights over <strong>CSS die de weergave blokkeert</strong>? Zijn je <strong>eerste weergave-tijden</strong> niet optimaal vanwege die blokkerende CSS?</p>\n      <p><strong>\"Kritische\" CSS</strong> (als onderdeel van Autoptimize\'s \"Belangrijke CSS in HTML voegen, de rest uitstellen?\" optie) kan helpen dat te verbeteren, maar de meeste sites hebben <strong>verschillende \"kritische CSS\" nodig voor verschillende soorten pagina\'s</strong> en het genereren van de juiste code kan moeilijk zijn!</p>\n      <p>De oplossing? Meld je aan op <a href=\"https://criticalcss.com/?aff=1\" target=\"_blank\">https://criticalcss.com</a> (premium service, prijs 2 GBP / maand voor lidmaatschap en 5 GBP / maand per domein) en haal de API-sleutel op van <a href=\"https://criticalcss.com/account/api-keys?aff=1\" target=\"_blank\">de API-sleutels-pagina</a> en plak die sleutel hieronder.</p>\n      <p>Als je vragen hebt of ondersteuning nodig hebt, ga dan naar ons <a href=\"https://wordpress.org/support/plugin/autoptimize\" target=\"_blank\">support forum</a> en we helpen je snel aan de slag!</p>\n    </div>\n    <div style=\"width:28%;float:right\"><img src=\"https://criticalcss.com/images/criticalcss-optimised-website-illustration.svg\" width=\"350px\"></div>\n    </div>\n</div>\n<div class=\'ao_i18n\' id=\'fr\'> \n  <h2>Am&eacute;liorer la vitesse du premier rendu (first paint) en supprimant les CSS bloquants</h2>\n    <div style=\"width:100%;overflow:hidden\">\n    <div style=\"width:68%;float:left\">\n      <p>Google Pagespeed Insights se plaint du <strong>CSS bloque le rendu</strong>? Votre <strong>vitesse de premier rendu d\'affichage</strong> est-elle ralentie par le CSS qui bloque le rendu ?</p>\n      <p><strong>Le CSS situ&eacute; au-dessus de la ligne de flottaison</strong> (la fonction \"Mettre en ligne et reporter le CSS\" d\'Autoptimize) peuvent &ecirc;tre b&eacute;n&eacute;fiques, mais la plupart des sites ont besoin de <strong>diff&eacute;rents CSS critiques pour diff&eacute;rents types de pages</strong>. G&eacute;n&eacute;rer le code correct peut &ecirc;tre difficile !</p>\n      <p>La solution? <strong>Inscrivez-vous sur <a href=\"https://criticalcss.com/?aff=1\" target=\"_blank\">https://criticalcss.com</a></strong> (service premium, prix 2 GBP / mois pour l\'adh&eacute;sion et 5 GBP / mois par domaine) <strong>et obtenez la cl&eacute; API <a href=\"https://criticalcss.com/account/api-keys?aff=1\" target=\"_blank\">&aacute; partir de la page des cl&eacute;s API</a></strong> et collez cette cl&eacute; ci-dessous.</p>\n      <p>Si vous avez des questions ou si vous avez besoin d\'assistance, rendez-vous sur <a href=\"https://wordpress.org/support/plugin/autoptimize\" target=\"_blank\">notre forum d\'assistance</a> et nous vous aiderons &aacute; vous mettre en route en un rien de temps !</p>\n    </div>\n    <div style=\"width:28%;float:right\"><img src=\"https://criticalcss.com/images/criticalcss-optimised-website-illustration.svg\" width=\"350px\"></div>\n    </div>\n</div>\n<div class=\'ao_i18n\' id=\'pt\'>\n	<h2>Melhore os tempos de primeira pintura ao remover o CSS que bloqueia renderiza&ccedil;&atilde;o</h2>\n  <div style=\"width:100%;overflow:hidden\">\n  	<div style=\"width:68%;float:left\">\n      <p>O Google Pagespeed Insights est&aacute; reclamando do <strong>CSS que bloqueia renderiza&ccedil;&atilde;o</strong>? Os <strong>tempos de primeira pintura</strong> est&aacute; abaixo do esperado por causa do CSS que bloqueia renderiza&ccedil;&atilde;o?</p>\n      <p>O <strong>CSS acima do scroll</strong> (como parte do CSS &quot;Adiado &amp; em Linha&quot; do Autoptimize) pode ajudar a resolver, mas a maior parte dos sites precisam de <strong>CSS cr&iacute;tico diferente para cada tipo de p&aacute;gina</strong> e gerar o c&oacute;digo correto pode ser dif&iacute;cil!</p>\n      <p>A solu&ccedil;&atilde;o? <strong>Assine <a href=\"https://criticalcss.com/?aff=1\" target=\"_blank\">https://criticalcss.com</a></strong> (servi&ccedil;o premium, pre&ccedil;o de 2 Libras/m&ecirc;s no modo assinatura e 5 Libras/m&ecirc;s por dom&iacute;nio), <a href=\"https://criticalcss.com/account/api-keys?aff=1\" target=\"_blank\">copia a chave API da p&aacute;ginas API-keys</a> e cole no campo abaixo.</p>\n      <p>Se voc&ecirc; tem alguma d&uacute;vida ou precisa de suporte, v&aacute; ao <a href=\"https://wordpress.org/support/plugin/autoptimize\" target=\"_blank\">nosso f&oacute;rum de suporte</a> e n&oacute;s vamos ajud&aacute;-lo a colocar para funcionar em pouco tempo!</p>\n    </div>\n  	<div style=\"width:28%;float:right\"><img src=\"https://criticalcss.com/images/criticalcss-optimised-website-illustration.svg\" width=\"350px\"></div>\n  </div>\n</div> \n\n','no');
