INSERT INTO `wp_postmeta` VALUES (266,23,'jobs_0_description','<ul class=\"resume__exp__list\">\r\n 	<li data-aos=\"fade-up\"><strong><span data-preserver-spaces=\"true\">Designed</span></strong><span data-preserver-spaces=\"true\">and</span><strong><span data-preserver-spaces=\"true\">consulted</span></strong><span data-preserver-spaces=\"true\">websites, microsites, and landing pages for 200+ B2B and B2C companies using strategies that reflect the end goals.</span></li>\r\n 	<li data-aos=\"fade-up\"><strong><span data-preserver-spaces=\"true\">Communicated</span></strong><span data-preserver-spaces=\"true\">ideas using sitemaps, wireframes, stylescapes, and prototypes to clients, including the SEO &amp; web development teams.</span></li>\r\n 	<li data-aos=\"fade-up\"><strong><span data-preserver-spaces=\"true\">Developed</span></strong><span data-preserver-spaces=\"true\">websites independently or with a team using HTML, SCSS, PHP, Bootstrap, Javascript, and jQuery in WordPress.</span></li>\r\n 	<li data-aos=\"fade-up\"><strong><span data-preserver-spaces=\"true\">Organized</span></strong><span data-preserver-spaces=\"true\">a pricing structure and design process for logos that generated revenue and expanded Compulse\'s portfolio and services offered.</span></li>\r\n 	<li data-aos=\"fade-up\"><strong><span data-preserver-spaces=\"true\">Mentored</span></strong><span data-preserver-spaces=\"true\">peers to better understand their abilities, strengthen their talents, and maximize their potential to the fullest.</span></li>\r\n 	<li data-aos=\"fade-up\"><strong><span data-preserver-spaces=\"true\">Revised</span></strong><span data-preserver-spaces=\"true\">QA system to better define an error by orderly narrowing down the browser, operating system, platform, and page in which the error originates.</span></li>\r\n 	<li data-aos=\"fade-up\"><strong><span data-preserver-spaces=\"true\">Spearheaded</span></strong><span data-preserver-spaces=\"true\">and</span><strong><span data-preserver-spaces=\"true\">executed</span></strong><span data-preserver-spaces=\"true\">a set limit of revisions preventing seemingly endless edits while encouraging decisive decision-making.</span></li>\r\n</ul>');
