INSERT INTO `wp_postmeta` VALUES (3560,133,'jobs_0_description','<ul class=\"resume--dashed-list\">\r\n 	<li data-aos=\"fade-up\"><strong>Designed</strong> and <strong>consulted</strong> websites, landing pages and microsites for 200+ B2B and B2C companies using strategies that reflect the end goals.</li>\r\n 	<li data-aos=\"fade-up\"><strong>Communicated</strong> ideas using sitemaps, wireframes, stylescapes and prototypes to clients as well as the SEO &amp; web development teams.</li>\r\n 	<li data-aos=\"fade-up\"><strong>Developed</strong> websites independently or with a team using HTML, SCSS, PHP, Bootstrap, Javascript and jQuery in WordPress.</li>\r\n 	<li data-aos=\"fade-up\"><strong>Organized</strong> a pricing structure and design process for logos that generated revenue and expanded the companys portfolio and services offered.</li>\r\n 	<li data-aos=\"fade-up\"><strong>Mentored</strong> peers to better understand their abilities, strengthen their talents and maximize their potential to the fullest.</li>\r\n 	<li data-aos=\"fade-up\"><strong>Revised</strong> QA system to better define an error by orderly narrowing down the browser, operating system, platform, and page in which the error originates.</li>\r\n 	<li data-aos=\"fade-up\"><strong>Spearheaded</strong> and <strong>executed</strong> a set limit of revisions preventing seemingly endless edits while encouraging decisive decision-making.</li>\r\n</ul>');
