INSERT INTO `wp_postmeta` VALUES (4726,17,'about_content','<h3>Currently, Im a senior web designer living and working near Charm City itself, Baltimore, MD.</h3>\r\nI specialize in helping movers and shakers solve pivotal problems by crafting <a href=\"/projects/\">compelling, asymmetrical websites</a> through thoughtful strategy and execution. My expertise ranges from website and app design to editorial, process design, and digital transformation.\r\n\r\nAside from designing, Im a hardcore gamer, die-hard metalhead, an aspiring composer, low-key health fanatic, and moonlight as a <a href=\"https://github.com/jatyburski\" target=\"_blank\" rel=\"nofollow noopener\">junior front-end developer</a>.');
