INSERT INTO `wp_postmeta` VALUES (8812,201,'about_content','<h3>Currently, Im a senior web designer living and working near Charm City itself, Baltimore, MD.</h3>\r\nMy days are spent crafting compelling <a href=\"/projects/\" title=\"Projects\">websites</a> through thoughtful strategy and execution. \r\n\r\nI led design at companies of various stages, taking a seed-stage esports startup from start to finish at Blitz to designing the next generation desktop client at Box.\r\n\r\nAside from doodling with shapes and gadgets, I am a hardcore gamer, die-hard SKT T1 fan, aspiring chef, tea aficionado, low-key kpop fan, and a potato addict. Furthermore, I moonlight as a junior front-end developer.');
