INSERT INTO `wp_postmeta` VALUES (11411,246,'about_content','<h3>Currently, Im a senior web designer living and working near Charm City itself, Baltimore, MD.</h3>\r\nI spend my days crafting<a href=\"/projects/\">compelling, asymmetrical websites</a> through thoughtful strategy and execution.\r\n\r\nAside from designing, Im a hardcore gamer, die-hard metalhead, an aspiring composer, low-key health fanatic, and <a href=\"https://github.com/jatyburski\" target=\"_blank\" rel=\"nofollow noopener\">moonlight as a juniorfront-end developer</a>.');
