INSERT INTO `wp_postmeta` VALUES (11417,246,'goals','<h2 data-aos=\"fade-up\">Goals &amp; Ambitions</h2>\r\n<ul class=\"p-0 m-0\">\r\n 	<li data-aos=\"fade-up\">\r\n<h3>Mature As A (More) Effective Communicator</h3>\r\nDemonstrate myself as confident in front of small audiences and, over the course of time, larger groups.</li>\r\n 	<li data-aos=\"fade-up\">\r\n<h3>Increase Self-Efficiency</h3>\r\nContinuously create coherent design systems, better understand the limitations of my bandwidth.</li>\r\n 	<li data-aos=\"fade-up\">\r\n<h3>Practice Leadership</h3>\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Aliquam ultricies purus justo, placerat sollicitudin dolor tempor nec. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.</li>\r\n 	<li data-aos=\"fade-up\">\r\n<h3>Network More with People</h3>\r\nAttend seminars and conferences that cover topics of interest with like-minded people and actually engage with them.</li>\r\n</ul>');
