INSERT INTO `wp_postmeta` VALUES (11758,225,'intro','<h2>I was a Lead Designer at Blitz (acquired by Discord), working to bridge the gap between esports fandom and personal gameplay. We built the first fully automatic coaching tool for League of Legends, with 100K WAU and 50% 30-day retention in just 6 months since the launch. We are also one of the premier esports publication covering League of Legends, CS:GO, and Overwatch.</h2>\r\n<h2>In my three years at Blitz, I led the evolution of the company from just an esports news app to a premier esports brand in NA by capturing a balance between function and form. Not one over the other, but a delicate balance that optimizes for both efficiency and delight.</h2>');
INSERT INTO `wp_postmeta` VALUES (11759,225,'_intro','field_5efb536dad4f9');
