INSERT INTO `wp_postmeta` VALUES (11774,225,'section_0_Content','<h2>The League tool that does it all. Automatically.</h2>\r\nThe Blitz Desktop App is the first fully automatic coaching tool for League of Legends. Once installed and running, it detects when the player has entered a live game and uses computer vision to instantly display teammate stats and recommended champion playstyle tips, runes, and item builds based on data from high-elo ranked games--no typing required.\r\n\r\nIts our first foray into a completely seamless robo-coaching experience for PC gaming. Our goal is to make player improvement as simple as possible (no more tabbing in and out of Chrome!), whether its by automating the champion select process or giving personalized performance assessments after each game.');
INSERT INTO `wp_postmeta` VALUES (11775,225,'_section_0_Content','field_5efd211f1626a');
